(20, 1, '2024-12-17 13:59:13', '2024-12-17 13:59:13', '<!-- wp:flatsome/uxbuilder -->\n[section label=\"Hero\" padding=\"0px\" margin=\"50px\"]\n\n[ux_slider]\n\n[ux_banner height=\"600px\" height__md=\"400px\" bg=\"36\" bg_overlay=\"rgba(0, 0, 0, 0.11)\" bg_pos=\"36% 45%\"]\n\n[text_box width=\"80\" position_x=\"50\" position_y=\"90\"]\n\n<h4 class=\"uppercase\">Step into style</h4>\n<h2 class=\"uppercase\"><strong>explore our latest fashion trends</strong></h2>\n[button text=\"Shop now\" size=\"large\" radius=\"27\" depth=\"4\" depth_hover=\"5\" link=\"/wordpress/shop/\"]\n\n\n[/text_box]\n\n[/ux_banner]\n[ux_banner height=\"600px\" height__md=\"400px\" bg=\"34\" bg_size=\"1536x1536\" bg_overlay=\"rgba(0, 0, 0, 0.279)\" bg_pos=\"35% 10%\"]\n\n[text_box width=\"80\" position_x=\"50\" position_y=\"90\"]\n\n<h2 class=\"uppercase\">New Arrivals Are Here!</h2>\n<h4>Upgrade Your Wardrobe Today.</h4>\n[button text=\"Shop now\" size=\"large\" radius=\"27\" depth=\"4\" depth_hover=\"5\" link=\"/wordpress/shop/\"]\n\n\n[/text_box]\n\n[/ux_banner]\n[ux_banner height=\"600px\" height__md=\"400px\" bg=\"40\" bg_size=\"1536x1536\" bg_overlay=\"rgba(0, 0, 0, 0)\" bg_pos=\"26% 50%\"]\n\n[text_box width=\"80\" position_x=\"50\" position_y=\"90\"]\n\n<h2 class=\"uppercase\">New Arrivals Are Here!</h2>\n<h4>Upgrade Your Wardrobe Today.</h4>\n[button text=\"Shop now\" size=\"large\" radius=\"27\" depth=\"4\" depth_hover=\"5\" link=\"/wordpress/shop/\"]\n\n\n[/text_box]\n\n[/ux_banner]\n[ux_banner height=\"600px\" height__md=\"400px\" bg=\"37\" bg_size=\"1536x1536\" bg_overlay=\"rgba(0, 0, 0, 0.227)\" bg_pos=\"46% 5%\"]\n\n[text_box width=\"80\" position_x=\"50\" position_y=\"90\"]\n\n<h2 class=\"uppercase\">New Arrivals Are Here!</h2>\n<h4>Upgrade Your Wardrobe Today.</h4>\n[button text=\"Shop now\" size=\"large\" radius=\"27\" depth=\"4\" depth_hover=\"5\" link=\"/wordpress/shop/\"]\n\n\n[/text_box]\n\n[/ux_banner]\n\n[/ux_slider]\n\n[/section]\n[section label=\"Categories\"]\n\n[row]\n\n[col span__sm=\"12\" padding=\"0px 0px 0px 0px\"]\n\n[title style=\"center\" text=\"SHOP BY COLLECTION\" tag_name=\"h1\"]\n\n[ux_product_categories style=\"overlay\" columns=\"3\" slider_nav_style=\"simple\" slider_nav_color=\"light\" ids=\"31,21,26,19\" show_count=\"0\" image_radius=\"2\" image_size=\"large\" image_overlay=\"rgba(0, 0, 0, 0.238)\" image_hover=\"overlay-remove-50\" image_hover_alt=\"zoom\" text_pos=\"middle\" text_size=\"large\"]\n\n\n[/col]\n\n[/row]\n\n[/section]\n[section label=\"Best Sellers\"]\n\n[row]\n\n[col span__sm=\"12\" padding=\"0px 0px 0px 0px\"]\n\n[title style=\"center\" text=\"best sellers\" tag_name=\"h1\"]\n\n[ux_products slider_nav_style=\"simple\" slider_nav_color=\"light\" show_cat=\"0\" show_quick_view=\"0\" cat=\"31\" orderby=\"date\"]\n\n\n[/col]\n\n[/row]\n\n[/section]\n[section label=\"testimonials\" margin=\"40px\"]\n\n[row]\n\n[col span__sm=\"12\" padding=\"0px 0px 0px 0px\"]\n\n[title style=\"center\" text=\"what our customers say\" tag_name=\"h1\"]\n\n\n[/col]\n\n[/row]\n[ux_slider hide_nav=\"true\" nav_style=\"simple\" nav_color=\"dark\" bullet_style=\"simple\"]\n\n[row width=\"custom\" custom_width=\"600px\"]\n\n[col span__sm=\"12\"]\n\n[testimonial image=\"175\" image_width=\"127\" pos=\"center\"]\n\n<h3>I love it </h3>\n<p>This is my go-to store for quality products at great prices. The website is easy to navigate, the checkout process is seamless, and the delivery is always on time!</p>\n\n[/testimonial]\n\n[/col]\n\n[/row]\n[row width=\"custom\" custom_width=\"600px\"]\n\n[col span__sm=\"12\"]\n\n[testimonial image=\"172\" image_width=\"69\" pos=\"center\"]\n\n<h3>Great customer service</h3>\n<p>Amazing customer service! They helped me choose the perfect items and even followed up to ensure I was satisfied. I’ll definitely shop here again.</p>\n\n[/testimonial]\n\n[/col]\n\n[/row]\n[row width=\"custom\" custom_width=\"600px\"]\n\n[col span__sm=\"12\"]\n\n[testimonial image=\"171\" image_width=\"69\" pos=\"center\"]\n\n<h3>Great product</h3>\n<p>I absolutely love the quality of the accessories I purchased! The designs are trendy, and they add the perfect finishing touch to my outfits. Fast shipping, too!</p>\n\n[/testimonial]\n\n[/col]\n\n[/row]\n[row width=\"custom\" custom_width=\"600px\"]\n\n[col span__sm=\"12\"]\n\n[testimonial image=\"173\" pos=\"center\"]\n\n<h3>Great product</h3>\n<p>I absolutely love the quality of the accessories I purchased! The designs are trendy, and they add the perfect finishing touch to my outfits. Fast shipping, too!</p>\n\n[/testimonial]\n\n[/col]\n\n[/row]\n\n[/ux_slider]\n\n[/section]\n[section label=\"featured product\"]\n\n[row]\n\n[col span__sm=\"12\" padding=\"0px 0px 0px 0px\"]\n\n[ux_product_flip ids=\"137\"]\n\n\n[/col]\n\n[/row]\n\n[/section]\n\n<!-- /wp:flatsome/uxbuilder -->', 'Accueil', '', 'publish', 'closed', 'closed', '', 'accueil', '', '', '2024-12-18 14:09:10', '2024-12-18 14:09:10', '', 0, 'http://localhost/wordpress/?page_id=20', 0, 'page', '', 0),
