(192, 1, '2024-12-18 14:54:21', '2024-12-18 14:54:21', '<!-- wp:flatsome/uxbuilder -->\n[section label=\"Title\" bg=\"191\" bg_size=\"1536x1536\" bg_color=\"rgba(0, 0, 0, 0.128)\" bg_overlay=\"rgba(0, 0, 0, 0.314)\" bg_pos=\"31% 50%\" dark=\"true\" height=\"350px\"]\n\n[row]\n\n[col span__sm=\"12\"]\n\n[gap]\n\n[ux_text font_size=\"1.7\" text_align=\"center\"]\n\n<h1>CONTACT US</h1>\n[/ux_text]\n\n[/col]\n\n[/row]\n\n[/section]\n[section label=\"Contact form\"]\n\n[row]\n\n[col span=\"6\" span__sm=\"12\"]\n\n<h2>Got Questions?</h2>\n<p>We’d love to hear from you! Whether you have questions about our products, need assistance with your order, or just want to share feedback, our team is here to help. Reach out to us through our contact form, email us  or call us . We strive to respond promptly and ensure your experience with us is exceptional.</p>\n<h2>Customer Service Hours</h2>\n<p>Our team is here to assist you during the following hours:</p>\n<ul>\n<li>Monday to Friday: 9:00 AM – 7:00 PM</li>\n<li>Saturday: 10:00 AM – 5:00 PM</li>\n<li>Sunday: Closed</li>\n</ul>\n<p>Feel free to reach out anytime during these hours, and we’ll be happy to help!</p>\n\n[/col]\n[col span=\"6\" span__sm=\"12\"]\n\n\n[/col]\n\n[/row]\n\n[/section]\n\n<!-- /wp:flatsome/uxbuilder -->', 'Contact', '', 'inherit', 'closed', 'closed', '', '22-revision-v1', '', '', '2024-12-18 14:54:21', '2024-12-18 14:54:21', '', 22, 'http://localhost/wordpress/?p=192', 0, 'revision', '', 0),
